import { React, useState } from "react";
import { Form, Button, Container, Row, Col } from "react-bootstrap";

const TripForm = ({ onSubmit }) => {
  const [startLocation, setStartLocation] = useState("");
  const [pickupLocation, setPickupLocation] = useState("");
  const [dropoffLocation, setDropoffLocation] = useState("");
  const [currentCycleHours, setCurrentCycleHours] = useState(0);
  const [startDate, setStartDate] = useState("");

  // // Remove the state variables and set static variables:
  // const startLocation = "123 Main St, Anytown, USA";
  // const pickupLocation = "O'Hare Airport, Chicago, IL";
  // const dropoffLocation = "Long Beach Port, CA";
  // const currentCycleHours = 68.5;
  // const startDate = "2024-01-10";

  const handleSubmit = (event) => {
    event.preventDefault();
    const formattedDate = moment(startDate).format("YYYY-MM-DD");
    // console.log(
    //   startLocation,
    //   pickupLocation,
    //   dropoffLocation,
    //   currentCycleHours,
    //   startDate
    // );
    onSubmit({
      startLocation,
      pickupLocation,
      dropoffLocation,
      currentCycleHours,
      startDate: formattedDate,
    });
  };

  return (
    <Container>
      <h2>Enter Trip Details</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Start Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter start location"
              value={startLocation}
              // readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Pickup Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter pickup location"
              value={pickupLocation}
              // readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Dropoff Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter dropoff location"
              value={dropoffLocation}
              // readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Current Cycle Hours:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="number"
              placeholder="Enter current cycle hours"
              value={currentCycleHours}
              // readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Start Date:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="date"
              placeholder="Enter start date"
              value={startDate}
              // readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Button variant="primary" type="submit">
          Generate Logs
        </Button>
      </Form>
    </Container>
  );
};

export default TripForm;
